import React from 'react'
import Seat from './Seat'

const Seats = ({ seats }) => {
    return (
        <>
        { seats.map((seat) => (
            <Seat key={ seat.pnr } seat={ seat } onToggle={toggleSeat}/>
        ))}
        </>

    )
}

const toggleSeat = (pnr) => {
    console.log(pnr)
}
export default Seats
